import styled from 'styled-components';

export const Container = styled.div`
  align-items: stretch;
  height: 100vh;
  width: 100vh;
  //box-sizing: border-box;
`

export const Content = styled.div`
  padding: 0px 140px;
  width: 100%;
  div{
    width: 100%;
    height: 20px;
    background-color: #000;
  }
`
